(66, 4, '2012-04-23 14:02:40', 'Magento Community Preview Version CE 1.7.0.0-RC1 has been released!', 'Learn more about the exciting new features and updates in this release and how you can take it for a test drive. As this is a preview version, we need to stress that it''s likely unstable and that we DON''T recommend that you use it in any production environment just yet.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-ce-1700-rc1-now-available/', 0, 0),
(67, 4, '2012-05-11 09:46:54', 'Magento Community 1.7 and Magento Enterprise 1.12 now available!', 'Learn more about the exciting new features and updates in these releases.', 'http://www.magentocommerce.com/blog/comments/magento-enterprise-112-and-community-17-now-available/', 0, 0),
(68, 4, '2012-06-20 18:54:07', 'Magento Community Edition 1.7.0.1 now available! ', 'We have just released an updated version of Magento Community Edition, version 1.7.0.1. This update delivers new, minor functionality and fixes for some potential security vulnerabilities.', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1701-released/', 0, 0),
(69, 4, '2012-07-05 19:21:43', 'Important Security Update - Zend Platform Vulnerability', 'We have recently learned of a serious vulnerability in the Zend platform on which Magento is built. Learn more and access a patch that addresses this issue. ', 'http://www.magentocommerce.com/blog/comments/important-security-update-zend-platform-vulnerability/', 0, 0),
(70, 3, '2012-06-08 07:56:20', 'Subscriptions and Recurring Payments v.1.8 by aheadWorks has been released!', 'The new version of the Subscriptions and Recurring Payments extension with considerable improvements gives new opportunities.', 'http://blog.aheadworks.com/2012/06/new-payment-methods-support-in-subscriptions-and-recurring-payments/?utm_source=feed&utm_medium=zefeed&utm_campaign=SARP_1_8', 0, 0),
(71, 3, '2012-06-02 08:03:49', 'AJAX Cart Pro v.2.5 by aheadWorks has been released!', 'Provide convenience for your clients with the updated version of the AJAX Cart Pro Magento extension.', 'http://blog.aheadworks.com/2012/06/provide-convenience-for-your-clients/?utm_source=feed&utm_medium=zefeed&utm_campaign=ACP_2_5', 0, 0),
(72, 3, '2012-05-03 07:32:32', 'Featured Products 3 v.3.3 by aheadWorks has been released!', 'Promote products effectively with the updated version of the Featured Products 3 Magento extension.', 'http://blog.aheadworks.com/2012/05/promote-products-effectively/?utm_source=feed&utm_medium=zefeed&utm_campaign=FP3_3_3', 0, 0),
(73, 3, '2012-04-27 08:00:35', 'Subscriptions and Recurring Payments v.1.7, Automatic Product Callouts v.1.2, and Product Updates Notifications v.1.2 by aheadWorks have been released!', 'Get New Opportunities with Our Extensions Updates!', 'http://blog.aheadworks.com/2012/04/get-new-opportunities-with-our-extensions-updates/?utm_source=feed&utm_medium=zefeed&utm_campaign=SARP_1_7_APC_1_2_PUN_1_2', 0, 0),
(74, 3, '2012-04-18 08:27:43', 'Custom Stock Display v.1.1 by aheadWorks has been released!', 'We released a new version of Magento module that will help avoid constant questions on the stock status.', 'http://blog.aheadworks.com/2012/04/keep-your-customers-informed/?utm_source=feed&utm_medium=zefeed&utm_campaign=CSD_1_1', 0, 0),
(75, 3, '2012-04-06 08:01:52', 'Advanced Search v.1.2 and Knowledge Base v.1.2 by aheadWorks have been released!', 'We released new versions of Magento modules that will help show careful attitude to your clients.', 'http://blog.aheadworks.com/2012/04/caring-attitude-is-the-key-to-long-term-client-relationship/?utm_source=feed&utm_medium=zefeed&utm_campaign=AS_1_2_KB_1_2', 0, 0),
(76, 3, '2012-03-30 08:19:57', 'Easy Categories v.1.1 and Image Slider v.1.3 by aheadWorks have been released!', 'We released new versions of Magento modules that will be helpful in making your website appealing for your clients.', 'http://blog.aheadworks.com/2012/03/images-are-the-best-way-of-grabbing-attention/?utm_source=feed&utm_medium=zefeed&utm_campaign=EC_1_1_IS_1_3', 0, 0),
(77, 3, '2012-03-23 09:00:20', 'Advanced Reports v.2.3 and Additional Units by aheadWorks have been released!', 'The new version of Advanced Reports is compatible with Magento CE 1.6.2.0. Don''t forget to update additional units as well.', 'http://blog.aheadworks.com/2012/03/get-detailed-and-accurate-sales-information-easily/?utm_source=feed&utm_medium=zefeed&utm_campaign=AR_2_3_Units', 0, 0),
(78, 3, '2012-03-20 14:25:50', 'iPhone Theme v.1.4.1 by aheadWorks has been released', 'The new version detects iPad automatically that means the desktop version of your online store will be displayed. ', 'http://blog.aheadworks.com/2012/03/be-mobile-and-get-more-potential-traffic/?utm_source=feed&utm_medium=zefeed&utm_campaign=iPhone_Theme_1_4_1', 0, 0),
(79, 3, '2012-03-14 12:55:57', 'Z-Blocks 2.2.6, Market Segmentation Suite 1.2.1, Follow Up Email 3.4, and Advanced Newsletter 2.2 by aheadWorks have been released!', 'Today we release the Magento extensions that were modified for you to get the best results in your target marketing. With their help, your promotions and sales become easier and more cost-effective.', 'http://blog.aheadworks.com/2012/03/divide-and-conquer-with-the-newest-versions-of-our-magento-extensions/?utm_source=feed&utm_medium=zefeed&utm_campaign=FUE_34_MSS_121_ZB_226_AN_22', 0, 0);
