(12, 'Banner1', 'home_banner.jpg', '<img src="http://clientreviews.info/furniture_store/media/Banners/images/thumb/home_banner.jpg" border="0" width="75" height="75" />', '', '_blank', 'yes', 'Brighten up your decor with our selection of lighting. The free standard ground shipping offer is good on all lighting as noted online. Offer not valid on items being shipped to Alaska, Hawaii or APO/FPO addresses.', 1, '2012-07-25 06:12:04', '2012-07-25 06:12:04'),
(13, 'banner2', 'home_banner_1.jpg', '<img src="http://clientreviews.info/furniture_store/media/Banners/images/thumb/home_banner_1.jpg" border="0" width="75" height="75" />', '', '_blank', 'yes', 'We offer a wide range of attractive, high quality pieces that are unique while maintaining functionality and comfort.', 1, '2012-07-25 06:13:02', '2012-07-25 06:13:02'),
(14, 'banner3', 'home_banner_2.jpg', '<img src="http://clientreviews.info/furniture_store/media/Banners/images/thumb/home_banner_2.jpg" border="0" width="75" height="75" />', '', '_blank', 'yes', 'Our selection, prices and in-home delivery and setup make it easy', 1, '2012-07-25 06:13:49', '2012-07-25 06:13:49'),
(15, 'banner4', 'home_banner_3.jpg', '<img src="http://clientreviews.info/furniture_store/media/Banners/images/thumb/home_banner_3.jpg" border="0" width="75" height="75" />', '', '_blank', 'yes', 'Discover a stylish selection of furniture and home decor. You''ll find home furnishings in a variety of decorating styles that are comfortable and affordable. Find furniture to complement any home and suit any taste!', 1, '2012-07-25 06:15:18', '2012-07-25 06:15:18');
