(23, 1, '7852|Enabled|None|Coaster Promenade Casual Leather Reclining Theater Sectional Group|Enjoy your next movie night with the enveloping comfort of this luxurious theater sectional group. The left and right arm facing recliners anchor each end of this unit, with a center armless loveseat for comfortable reclining options to accommodate the whole family. The modular storage wedges create hidden storage options for your books, magazines, newspapers, and remotes, with built in cup holders for drinks. High back cushions and deep pad over chaise seats will support you from head to toe, with a ultra comfy pillow top arms adding the perfect finishing touch in soft black leather match. Configure these theater seating components|Enjoy your next movie night with the enveloping comfort of this luxurious theater sectional group. The left and right arm facing recliners anchor each end of this unit, with a center armless loveseat for comfortable reclining options to accommodate the whole family.|2365.2|1'),
(21, 1, '4234133|Enabled|None|Round Pub Table with Metal Base and Faux Marble Top|This elegant pub table is a masterfully designed piece with a unique and winsome style that is unparalleled. A faux marble top table ads grace while the antique bronze finish of the metal base and legs gives a strong and stylish presence. Designed to match beautifully with the coordinating stools, this table makes an excellent addition to any room in your home.|This elegant pub table is a masterfully designed piece with a unique and winsome style that is unparalleled. A faux marble top table ads grace while the antique bronze finish of the metal base and legs gives a strong and stylish presence. Designed to match beautifully with the coordinating stools, this table makes an excellent addition to any room in your home.|226.8|1'),
(22, 1, '345|Enabled|None|Lacey|The rich contemporary design of the Lacey dining room collection features faux marble and a subtle rustic beauty to create a sophisticated atmosphere that is sure to enhance any dining experience. The thick profiled faux marble table top is covered with a clear polyurethane finish and is supported by the slightly tapered contemporary legs in a dark brown finish. The brown vinyl upholstered chairs features the rich look of faux leather with stylish stitching and button tufting to further enhance the upscale contemporary design of this dining collection. Create a sophisticated style for your dining room decor with the inviting feel of the Lacey dining room collection.|The rich contemporary design of the Lacey dining room collection features faux marble and a subtle rustic beauty to create a sophisticated atmosphere that is sure to enhance any dining experience. The thick profiled faux marble table top is covered with a clear polyurethane finish and is supported by the slightly tapered contemporary legs in a dark brown finish. The brown vinyl upholstered chairs features the rich look of faux leather with stylish stitching and button tufting to further enhance the upscale contemporary design of this dining collection. Create a sophisticated style for your dining room decor with the inviting feel of the Lacey dining room collection.|12345|1'),
(19, 1, '4564|Enabled|None|Shelton Traditional Rectangular End Table|Accent your living room furniture with the stylish rectangular end table. A traditional styled nailhead accent and decorative hardware create a warm and inviting look. Two drawers allow for convenient storage of books, magazines, remotes and reading glasses. Pair with the matching chairside end table, sofa table and cocktail table.|Accent your living room furniture with the stylish rectangular end table. A traditional styled nailhead accent and decorative hardware create a warm and inviting look. Two drawers allow for convenient storage of books, magazines, remotes and reading glasses. Pair with the matching chairside end table, sofa table and cocktail table.|251.98|1'),
(20, 1, '45|Enabled|None|Bedroom TV Armoire|Perfect for use with a TV and for organized bedroom storage, this traditional style armoire offers graceful style and function to your master bedroom. The two-tone look of the medium chestnut finish with burl inlays on the two door and two drawer fronts create an impressive look. Intricate hand carved details complete the classic style of this TV Armoire.|Perfect for use with a TV and for organized bedroom storage, this traditional style armoire offers graceful style and function to your master bedroom. The two-tone look of the medium chestnut finish with burl inlays on the two door and two drawer fronts create an impressive look. Intricate hand carved details complete the classic style of this TV Armoire.|1629.6|1'),
(16, 1, '0609-AC-BLK|Enabled|None|Swivel Arm Chair on Casters|This luxurious Arm Chair features a wonderful Swivel Mechanism and casters for extra support. Additionally, the Chrome framing and beautiful Black Vinyl upholstery enhance its commitment to grace and sophistication.|This luxurious Arm Chair features a wonderful Swivel Mechanism and casters for extra support. Additionally, the Chrome framing and beautiful Black Vinyl upholstery enhance its commitment to grace and sophistication.|285.7|1'),
(17, 1, 'R134|Enabled|None|Soho - Black Rug|The Soho - Black Rug by Ashley Furniture. Crafted with uncommon quality, this exquisite collection features a series of designs capturing the essence of contemporary majesty. The rugs are made from nylon(100%). This extraordinary combination of design, color and styling will add a wonderful accent to any setting. Series No: R134 Name: Soho - Black Style: Contemporary Set Includes: 1 (5ft X 7ft 4inch) Features: Contemporary style. Clean Code: DC, Dry Clean Only Fabric Content: nylon(100%) Dimensions: R134001 Area Rug 7 ft 6 inch X 9 ft 10 inch R134002 Area Rug 5 ft X 7 ft 4 inch|The Soho - Black Rug by Ashley Furniture. Crafted with uncommon quality, this exquisite collection features a series of designs capturing the essence of contemporary majesty. The rugs are made from nylon(100%). This extraordinary combination of design, color and styling will add a wonderful accent to any setting.|328.56|1'),
(18, 1, '012643-SET|Enabled|None|Perfect Sleeper Sanders Mattress-Super Pillow Top Set|The Perfect Sleeper Sanders Mattress-Super Pillow Top Set from the Perfect Sleeper Collection designed and manufactured by Serta guarantees endless comfort and timeless quality. Like any other product from this manufacturer, you can expect this mattress to live up to all of your expectations and even more, due to its innovative features and design. Misty Midnight has the 532-continuous innerspring support system made from continuous coils that are placed from head to toe to enhance comfort and lessen the impact of partner movements. The latter is also ensured by the stable base dual beam that significantly reduces the mattress sway. The Super Pillow top upholstery features the fire blocker insulator covering the two-inch comfort foam; while the bottom includes the fire blocker system with support foam and fire blocker insulator to prevent traumas when the mattress is exposed to open flame. The advanced comfort quilt with another layer of fire blocker and soft convoluted foam and one-inch comfort foam are designed to reduce body pressure and improve surface comfort and overall body circulation. The Perfect Sleeper Sanders Mattress featured in the Perfect Sleeper Collection is available in California King, King, Queen, Twin, Full, and Twin Extra Long sizes. Please note: King & California King Mattress Boxspring is a 2 piece boxspring. FREE Boxspring included. Set Includes: 1 Sanders Mattress-Super Pillow Top (Twin) Features: Perfect Sleeper Collection Serta quality Continuous Support System Foam encasement Stable-Base Dual Beam Frame Fire Blocker System Comfort foam Convoluted foam Advanced Comfort Quilt Euro top Dimensions: Twin: W39 x L75" Twin extra long: W39" x L80" Full: W54" x L75" Queen: W60" x L80" King: W76" x L80" California King: W72" x L84" Mattress Height 15" (Mattress only)|The Perfect Sleeper Sanders Mattress-Super Pillow Top Set from the Perfect Sleeper Collection designed and manufactured by Serta guarantees endless comfort and timeless quality. Like any other product from this manufacturer, you can expect this mattress to live up to all of your expectations and even more, due to its innovative features and design.|1428.56|1'),
(15, 1, '418-997P-CRIB-SET|Enabled|None|Spring Garden Baby Room Set w/ Pink Metal Crib|Spring Garden Baby Room Set w/ Pink Metal Crib by Lea Industries. This set will remind you of being a child and running through a field on a warm and breezy spring day picking flowers and discovering all the soft colors of nature. The crib features three position mattress support elegant design soft curves supported by spindles with graceful detail. This stylish metal crib also meets safety guidelines and is JPMA certified. You can also add a Changing Top and 3-Drawer or 6-Drawer Dresser which provides sufficient storage for baby''s clothes. The dresser is crafted from hardwoods and other wood products and comes in a beautiful white finish with accompanying hardwood knob handles in white pink and yellow. The Spring Garden Collection can help you create your perfect nursery. Set Includes: 1 Pink Metal Crib, 1 Nightstand; Optional Item(s): Changing Table Top White, Single Dresser, Drawer Chest, Double Dresser Features: Durable construction. Crafted of metal. Bed features Pastel Pink Painted finish. Three position mattress support. Metal frame mattress support. Lead free finishes. No sharp edges or corners. White nightstand and dresser comes with 3 colored hardware knobs: White Pink and Yellow. Pink nightstand comes with pink knob and Yellow nightstand comes with yellow knob. Crib meets or exceeds the American Society for testing and material safety standards developed in conjunction with the Consumer Product Safety Commission & Certified by the Juvenile Products Manufacturer Association. Dimensions: Metal Crib W-55" x D-32" x H-49" Nightstand W-20" x D-16" x H-30" Chest W-36" x D-18" H-51" Single Dresser W-44" x D-18" x H-30" Double Dresser W-54" x D-18" x H-32"|Spring Garden Baby Room Set w/ Pink Metal Crib by Lea Industries. This set will remind you of being a child and running through a field on a warm and breezy spring day picking flowers and discovering all the soft colors of nature. The crib features three position mattress support elegant design soft curves supported by spindles with graceful detail.|1575|1'),
(14, 1, '4050PANSET|Enabled|None|Diana Panel Bedroom Set|The Diana Panel Bedroom Set is manufactured by Standard Furniture as part of the Diana Youth Bedroom Collection. Give your princess her own Victorian retreat. Some pieces feature open panel construction with metal roller bearing glides. Other pieces feature folded case side construction with center-mounted runners. Mirrors are back mounted and reinforced. With its simulated, white wash wood grain color and brushed-white, brass color swing bail pulls and clear plastic knobs, this set will give your daughter the fairytale bedroom she has always dreamed of. This set consists of bed (full/queen headboard), nightstand, dresser & mirror. Set Includes: 1 Panel Full/Queen Headboard, 1 Door Dresser, 1 Panel Mirror, 1 Nightstand; Optional Item(s): TV Chest, Computer Desk w/ Hutch, Chest 5- Drawer, Computer Desk Features: Diana Collection. Wood products with simulated wood grain laminates. This group may contain plastic parts. Some pieces feature open panel construction with metal roller bearing glides. Other pieces feature folded case side construction with center-mounted runners. Mirrors are back mounted and reinforced. Brushed-white, brass color swing bail pulls and clear plastic knobs. Bun feet raise cases off the floor Case doors open to reveal spacious storage compartments. Desk keyboard operates on metal glide system. Desk hutch accommodates two CD towers. Profiled toe plates complement overall flowing feel. Dimensions: Headboard Panel (Full/Queen): 56"H x 64"W x 2"D 4057 Nightstand 22"W x 16"D x 24"H 4058 Single Dresser 32"W x 16"D x 32"H 4059 Door Dresser 58"W x 16"D x 32"H 4068 Twin Panel Mirror 31"W x 44"H 4055 5- Drawer Chest 32"W x 16"D x 48"H 4056 TV Chest 39"W x 18"D x 40"H 4084 Computer Desk 47"W x 21"D x 30"H 4085 Hutch 45"W x 12"D x 49"H|The Diana Panel Bedroom Set is manufactured by Standard Furniture as part of the Diana Youth Bedroom Collection. Give your princess her own Victorian retreat. Some pieces feature open panel construction with metal roller bearing glides. Other pieces feature folded case side construction with center-mounted runners. Mirrors are back mounted and reinforced. With its simulated, white wash wood grain color and brushed-white, brass color swing bail pulls and clear plastic knobs, this set will give your daughter the fairytale bedroom she has always dreamed of.|1166.61|1'),
(12, 1, 'T233-4|Enabled|None|Antigo Sofa Table|Fill your home with warm memories of days gone by with the Antigo Sofa Table by Ashley Furniture With the natural slate tiling and the “gunmetal” color finish, you can bring back the memories of backyards and barbecues of youth. The unique grilled shelf and range of tones within the tiles bring the outdoors into the warm comfort of your own living room. Welded metal frames with a baked epoxy finish gives the "Antigo" occasional table collection the strength that the look demands. Features: Wrought Iron Frames Baked Epoxy Gunmetal Color Finish Tile Inserts of Natural Slate Tiles Grilled shelf Dimensions: Sofa Table: 29"H x 48"Wx 20"D|Fill your home with warm memories of days gone by with the Antigo Sofa Table by Ashley Furniture With the natural slate tiling and the “gunmetal” color finish, you can bring back the memories of backyards and barbecues of youth. The unique grilled shelf and range of tones within the tiles bring the outdoors into the warm comfort of your own living room. Welded metal frames with a baked epoxy finish gives the "Antigo" occasional table collection the strength that the look demands.|357.13|1'),
(13, 1, 'W403-24(2)-25-60|Enabled|None|Pinella Entertainment Wall|The clean look of sophisticated style comes to life with the rich finish and contemporary accents of the beautifully designed Pinella Entertainment Wall by Signature Design. Bathed in a rich merlot finish, this entertainment wall is perfectly accented with silver color finished ring pull hardware and glass shelves within the lighted piers to create an overall contemporary atmosphere to enhance any living environment. With clear glass doors on the curved front of the credenza, this furniture fits flawlessly into any decor. Accent the beauty of your living area with the contemporary design of the "Pinella" entertainment wall. Features: Durable construction. Stylish and practical furniture design. Merlot finish over replicated mahogany grain. Elegant reeded ring pull hardware. Side roller glide drawer system for smooth operating drawers. Glass shelves with lighted piers. 60" wide TV credenza with curved drawer. Front glass doors and adjustable shelves. Bridge with shelf. Sharp looking reeded moulding. Dimensions: W403-24 (2) Pier Cabinet 20"W x 15"D x 64"H W403-25 Bridge 66"W x 17"D x 8"H W403-60 60 inch Credenza 60"W x 20"D x 24"H Some assembly may be required.|The clean look of sophisticated style comes to life with the rich finish and contemporary accents of the beautifully designed Pinella Entertainment Wall by Signature Design. Bathed in a rich merlot finish, this entertainment wall is perfectly accented with silver color finished ring pull hardware and glass shelves within the lighted piers to create an overall contemporary atmosphere to enhance any living environment. With clear glass doors on the curved front of the credenza, this furniture fits flawlessly into any decor. Accent the beauty of your living area with the contemporary design of the "Pinella" entertainment wall.|1042.84|1'),
(11, 1, '100173-174|Enabled|None|Marble Top Bar Set|The Marble Top Bar Set by Coaster features 3 drawers and a wine rack on each end, a set of cabinets, a large preparation area and a beautiful marble counter top. Matching bar stool features faux wicker design with a leather seat. Set Includes: 2 29 Inch Brown Barstool, 1 Marble Top Brown Bar Features: Durable construction. Stylish and practical furniture design. 3 drawers. Wine rack on each end. Set of cabinets. Large preparation area. Marble counter top. Bar stool features faux wicker design with a leather seat. Dimensions: Bar Unit: 20"l 60"w 42"h Barstool: 24"l 25"w 46"h Some assembly may be required.|The Marble Top Bar Set by Coaster features 3 drawers and a wine rack on each end, a set of cabinets, a large preparation area and a beautiful marble counter top. Matching bar stool features faux wicker design with a leather seat.|1955.18|1'),
(7, 1, '100771|Enabled|None|Rich Cappuccino Table|The Rich Cappuccino Table by Coaster with its smooth design and rich coloring is sure to embellish any home environment. This elegant table is crafted from solid hardwoods and features a wood veneer table top. With its clean lines and stylish look this contemporary piece from the Rich Cappuccino Collection will easily blend with your dining interior. Features: Contemporary style Rich cappuccino finish Solid hardwoods Wood veneer table top Dimensions: Table: 60”L x 36”W x 30”H Some assembly may be required.|The Rich Cappuccino Table by Coaster with its smooth design and rich coloring is sure to embellish any home environment. This elegant table is crafted from solid hardwoods and features a wood veneer table top. With its clean lines and stylish look this contemporary piece from the Rich Cappuccino Collection will easily blend with your dining interior.|399.99|1'),
(8, 1, 'D199-113|Enabled|None|Berringer Pub Set|The rich country style of the Berringer Pub Set from the "Berringer" Dining Room Collection reflects back to the days when beautifully crafted furniture was made by hand to enhance the look of your home. The rich rustic look of the hand-applied finish flawlessly coats the sturdy construction of this exceptional dining room furniture to create a warm inviting atmosphere for any dining experience. With the simple beauty of this country styled furniture, the “Berringer” Casual Dining Collection is sure to enhance any home’s beauty. Series No: D199 Name: Berringer Style: Cottage Colors: Rustic Features: Solid hardwood construction. Rustic hand applied finish. Backless bar stool features faux leather upholstery. Dimensions: Rect Pub Table w/ Two 24in Backless Barstools (3/Ctn) 32"W x 24"D x 34"H Table 32"W x 24"D x 34"H FROM FLOOR TO TABLE APRON 30 7/8" FROM FLOOR TO TABLE STRETCHER 5 3/8" Barstool (2) 19"W x 11 7/8"D x 24 1/8"H BARSTOOL FOOT REST HEIGHT 9 1/16" Some assembly may be required.|The rich country style of the Berringer Pub Set from the "Berringer" Dining Room Collection reflects back to the days when beautifully crafted furniture was made by hand to enhance the look of your home. The rich rustic look of the hand-applied finish flawlessly coats the sturdy construction of this exceptional dining room furniture to create a warm inviting atmosphere for any dining experience. With the simple beauty of this country styled furniture, the “Berringer” Casual Dining Collection is sure to enhance any home’s beauty.|399.99|1'),
(6, 1, 'D553-FORMAL-DR-SET|Enabled|None|North Shore Formal Dining Room Set|A deep rich stained finish and exquisite details come together to create the ultimate in grand traditional design with the elegance of the North Shore Formal Dining Room Set by Millennium by Ashley Furniture from the "North Shore" Dining Room Collection. The opulent brown stained finish flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any dining experience. With the comfort and beauty of elegant chairs, this furniture collection takes traditional style to the next level. Transform your dining area with the rich style of the "North Shore" Dining Room Collection. Series No: D553 Name: North Shore Style: Traditional Colors: Dark Brown Finish Part of the North Shore Dining Room Collection by Millennium by Ashley Furniture Set Includes: 2 Side Chair (Set of 2), 1 Arm Chair (Set of 2), 1 Extension Pedestal Table; Optional Item(s): Server, China Buffet, Buffet Features: Distressed dark opulent brown stained finish. Constructed with select hardwood veneers, hardwood solids and furniture grade resin. Large scale decorative pilasters and ornately detailed appliques. Framed drawer fronts. Felt-lined flatware tray with dust cover. Mirror back china with three way "touch" light switch. Dimensions: Extension Pedestal Table 44"W x 44/108 x 30"H Side Chair (RTA) (2/Ctn) 22"W x 22"D x 44"H Arm Chair (RTA) (2/Ctn) 22"W x 24"D x 44"H D553-80 Buffet 70"W x 18"D x 34"H CENTER ADJUSTABLE SHELF 18 3/16" x 13 11/16" x 3/4" CENTER DRAWER (LINED) 17 1/16" x 12 1/2" x 2 1/2" DOOR OPENING (3) 18 1/4" x 13 3/4" x 19 7/8" SIDE ADJUSTABLE SHELF (2) 20 9/16" x 13 3/4" x 3/4" SIDE DRAWER (LINED)(2) 17 1/16" x 12 1/2" x 2 13/16" D553-81 China 70"W x 18"D x 57"H DOOR OPENING 32 1/2" x 13 5/8" x 44" D553-60 Server 71"W x 20"D x 42"H ADJUSTABLE SHELF (2) 20 1/8" x 14 5/8" x 5/8" CENTER BOTTOM DRAWER (LINED) (2) 20 1/16" x 14" x 6 1/8" CENTER MIDDLE DRAWER (LINED) 20 1/16" x 14" x 8 3/4" DOOR OPENING (2) 17 1/2" x 16" x 27 1/2" TOP CENTER DRAWER (LINED) 20 1/16" x 14" x 2 3/4" TOP SIDE DRAWER (LINED) (2) 15 1/2" x 13" x 2 3/4" Some assembly may be required.|A deep rich stained finish and exquisite details come together to create the ultimate in grand traditional design with the elegance of the North Shore Formal Dining Room Set by Millennium by Ashley Furniture from the "North Shore" Dining Room Collection. The opulent brown stained finish flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any dining experience. With the comfort and beauty of elegant chairs, this furniture collection takes traditional style to the next level. Transform your dining area with the rich style of the "North Shore" Dining Room Collection.|2393.88|1'),
(4, 1, 'FX00033964|Enabled|None|TCamilla Nightstand|With a rich finish and ornate details, the Camilla Nightstand by Millennium from the "Camilla" bedroom collection takes rich traditional design to create an atmosphere of sophistication that is sure to enhance any home decor. The rich cherry veneer is bathed in a dark brown finish that beautifully enhances the pecan veneer accented case tops creating an elegant furniture collection. With antique bronze color hardware adorning the case pieces, this bedroom furniture perfectly captures the atmosphere of grand traditional design. Create the bedroom of your dreams with the rich traditional elegance of the "Camilla" Bedroom Collection. Series No: B622 Name: Camilla Style: Traditional Colors: Brown Cherry Stain Finish Part of the Camilla Bedroom Set by Millennium Features: Made with select cherry veneer and hardwood solids. Pecan veneer accented tops. Dark brown finish. Antique bronze color hardware. Dimensions: Night Stand 35"W x 19"D x 31"H Bottom Drawers (2) 26 X 14 1/2 X 5 1/2 Top drawer: Black felt lined 26 X 14 1/2 X 5 1/2 Some assembly may be required.|With a rich finish and ornate details, the Camilla Nightstand by Millennium from the "Camilla" bedroom collection takes rich traditional design to create an atmosphere of sophistication that is sure to enhance any home decor. The rich cherry veneer is bathed in a dark brown finish that beautifully enhances the pecan veneer accented case tops creating an elegant furniture collection. With antique bronze color hardware adorning the case pieces, this bedroom furniture perfectly captures the atmosphere of grand traditional design. Create the bedroom of your dreams with the rich traditional elegance of the "Camilla" Bedroom Collection.|4629.99|1'),
(5, 1, '15400-LR-SET|Enabled|None|Bradington - Truffle Living Room Set|Millennium by Ashley© Furniture has grown to become the largest home furniture manufacturing company. Millennium by Ashley© Furniture has a rich history of success stories that illustrate its dramatic transition from a ‘virtual unknown’ to a significant force in the industry. For over half of a century, the Millennum by Ashley© Furniture has remained committed to its Vision Statement: "We Want To Be The Best Furniture Company." Innovative marketing concepts, quality products and state-of-the-art manufacturing methods have always been driven by the demand for customer satisfaction. The stream of satisfied customers continues to grow as Signature Design by Ashley© Furniture continues to be creative and diversifies to expand business, and improve quality into the next millennium.|Millennium by Ashley© Furniture has grown to become the largest home furniture manufacturing company. Millennium by Ashley© Furniture has a rich history of success stories that illustrate its dramatic transition from a ‘virtual unknown’ to a significant force in the industry. For over half of a century, the|1691.15|1'),
(1, 1, 'abc|Enabled|None|Eero Aarnio Ball Chair|Eero Aarnio Ball Chair 599 plus 200 shipping Brand new and will ship within 24 hours! 30 day 100% money back guarantee! This reproduction of Eero Aarnio''s Ball Chair is definitely unique in its design. This retro lounge chair resembles a space-age pod which creates interest for anyone who sees it. The inner shell lined with fabric offers a sense of privacy and retreat as you relax in the plush cushion seating. It''s exterior; Molded fiberglass shell and matching fiberglass base with an integrated swivel mechanism. Features poly/cotton, molded fiberglass shell and matching fiberglass swivel base. Fiberglass shell Gel coated finish to prevent chips and scratches. Features * Product Dimensions: 42" x 49" x 37" * Item Ships Freight * Fiberglass Shell * Poly / Cotton Interior * Swivel Base The Ball Chair - or Globe Chair as it''s called sometimes - was designed by using one of the most simple geometric forms - the ball. Cutting of a part and fixing it at one point Eero Aarnio comes to a remarkable result - a completely unconventional shaped chair. A Ball Chair is a "room within a room" with a cozy and calm athmosphere, protecting outside noises and giving a private space for relaxing or having a phonecall. Turning around its own axis on the base the view to the outer space is variable for the user and thus he i The Vitra Design Museum notes in his brochure on the Ball Chair miniature: "It is something between a piece of furniture and a piece of architecture and at the same time embodies both the mobile and the established, the fixed." - You''ll find this miniature at the Vitra Design Museum''s Shop.|Eero Aarnio Ball Chair 599 plus 200 shipping Brand new and will ship within 24 hours! 30 day 100% money back guarantee! This reproduction of Eero Aarnio''s Ball Chair is definitely unique in its design. This retro lounge chair resembles a space-age pod which creates interest for anyone who sees it. The inner shell lined with fabric offers a sense of privacy and retreat as you relax in the plush cushion seating. It''s exterior; Molded fiberglass shell and matching fiberglass base with an integrated swivel mechanism.|8000|1'),
(2, 1, 'ash|Enabled|None|North Shore Sleigh Bedroom Set|A rich traditional design and exquisite details of the North Shore Media Chest come together to create the ultimate in the grand style of the "North Shore" Bedroom Collection. The opulent brown color flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any home environment. With a serpentine shaped design and inlay stone veneer tops, this furniture collection takes traditional style to the next level. Transform your bedroom with the rich style of the "North Shore" Bedroom Collection. Series No: B553 Name: North Shore Style: Old World Colors: Brown Part of the North Shore Bedroom Set Features: Constructed with select hardwood veneers, hardwood solids and furniture grade resin. Dark casual finish. Dark colored metal accents & hardware. Large scale decorative pilasters and ornately detailed appliques. Serpentine shaped drawer fronts. Framed drawer fronts. Cedar veneer or felt lined drawer bottoms. Dimensions: B553-39 Media Chest 42"W x 19"D x 42"H Some assembly may be required.|A rich traditional design and exquisite details of the North Shore Media Chest come together to create the ultimate in the grand style of the "North Shore" Bedroom Collection. The opulent brown color flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any home environment. With a serpentine shaped design and inlay stone veneer tops, this furniture collection takes traditional style to the next level. Transform your bedroom with the rich style of the "North Shore" Bedroom Collection.|4112.06|1'),
(3, 1, 'FX00005421|Enabled|None|Timberline Queen / Full Panel Headboard|The Timberline Queen / Full Panel Headboard by Signature Design by Ashley Furniture from the "Timberline" bedroom collection grasps the true beauty of country style furniture and brings it to your home. The replicated brown cherry grain is beautifully accented by the nicely scaled fretwork on the arched style of the headboard and mirror. Dream sweet dreams within the beauty of the rich country styled Timberline Bedroom Collection. FREE Bedframe included. Series No: B258 Name: Timberline Style: Rustic Master Bedroom Signature Casegoods Colors: Replicated Cherry Grain Part of the Timberline Bedroom Set by Signature Design by Ashley Furniture Features: Replicated warm brown Timber Cherry grain. Nicely scaled accent fretwork. Dimensions: Queen/Full Panel Headboard 67"W x 3"D x 50"H Queen (Bolt-on) Bedframe 61"W x 70"D x 9"H Some assembly may be required.|The Timberline Queen / Full Panel Headboard by Signature Design by Ashley Furniture from the "Timberline" bedroom collection grasps the true beauty of country style furniture and brings it to your home. The replicated brown cherry grain is beautifully accented by the nicely scaled fretwork on the arched style of the headboard and mirror. Dream sweet dreams within the beauty of the rich country styled Timberline Bedroom Collection.|499.99|1');
