INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1, 4, 61, 0, 1, 'Eero Aarnio Ball Chair 599 plus 200 shipping Brand new and will ship within 24 hours! 30 day 100% money back guarantee! This reproduction of Eero Aarnio''s Ball Chair is definitely unique in its design.\r\n<img src="{{media url="wysiwyg/tmp01_1_.jpg"}}" alt="" />\r\nThis retro lounge chair resembles a space-age pod which creates interest for anyone who sees it. The inner shell lined with fabric offers a sense of privacy and retreat as you relax in the plush cushion seating. It''s exterior; Molded fiberglass shell and matching fiberglass base with an integrated swivel mechanism.\r\n\r\nFeatures poly/cotton, molded fiberglass shell and matching fiberglass swivel base. Fiberglass shell Gel coated finish to prevent chips and scratches. Features * Product Dimensions: 42" x 49" x 37" * Item Ships Freight * Fiberglass Shell * Poly / Cotton Interior * Swivel Base\r\n\r\nThe Ball Chair - or Globe Chair as it''s called sometimes - was designed by using one of the most simple geometric forms - the ball. Cutting of a part and fixing it at one point Eero Aarnio comes to a remarkable result - a completely unconventional shaped chair.\r\n\r\nA Ball Chair is a "room within a room" with a cozy and calm athmosphere, protecting outside noises and giving a private space for relaxing or having a phonecall. Turning around its own axis on the base the view to the outer space is variable for the user and thus he i \r\n\r\nThe Vitra Design Museum notes in his brochure on the Ball Chair miniature: "It is something between a piece of furniture and a piece of architecture and at the same time embodies both the mobile and the established, the fixed." - You''ll find this miniature at the Vitra Design Museum''s Shop.\r\n'),
(2, 4, 62, 0, 1, 'Eero Aarnio Ball Chair 599 plus 200 shipping Brand new and will ship within 24 hours! 30 day 100% money back guarantee! This reproduction of Eero Aarnio''s Ball Chair is definitely unique in its design.\r\n\r\nThis retro lounge chair resembles a space-age pod which creates interest for anyone who sees it. The inner shell lined with fabric offers a sense of privacy and retreat as you relax in the plush cushion seating. It''s exterior; Molded fiberglass shell and matching fiberglass base with an integrated swivel mechanism.'),
(3, 4, 72, 0, 1, ''),
(4, 4, 95, 0, 1, ''),
(5, 4, 61, 0, 2, 'A rich traditional design and exquisite details of the North Shore Media Chest come together to create the ultimate in the grand style of the "North Shore" Bedroom Collection. The opulent brown color flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any home environment. With a serpentine shaped design and inlay stone veneer tops, this furniture collection takes traditional style to the next level. Transform your bedroom with the rich style of the "North Shore" Bedroom Collection.\r\n\r\nSeries No: B553\r\nName: North Shore\r\nStyle: Old World\r\nColors: Brown\r\nPart of the North Shore Bedroom Set\r\n\r\nFeatures:\r\n Constructed with select hardwood veneers, hardwood solids and furniture grade resin.\r\n Dark casual finish.\r\n Dark colored metal accents & hardware.\r\n Large scale decorative pilasters and ornately detailed appliques.\r\n Serpentine shaped drawer fronts.\r\n Framed drawer fronts.\r\n Cedar veneer or felt lined drawer bottoms.\r\n\r\nDimensions:\r\n B553-39 Media Chest 42"W x 19"D x 42"H\r\n\r\nSome assembly may be required.'),
(6, 4, 62, 0, 2, 'A rich traditional design and exquisite details of the North Shore Media Chest come together to create the ultimate in the grand style of the "North Shore" Bedroom Collection. The opulent brown color flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any home environment. With a serpentine shaped design and inlay stone veneer tops, this furniture collection takes traditional style to the next level. Transform your bedroom with the rich style of the "North Shore" Bedroom Collection.'),
(7, 4, 72, 0, 2, ''),
(8, 4, 95, 0, 2, ''),
(9, 4, 61, 0, 3, 'The Timberline Queen / Full Panel Headboard by Signature Design by Ashley Furniture from the "Timberline" bedroom collection grasps the true beauty of country style furniture and brings it to your home. The replicated brown cherry grain is beautifully accented by the nicely scaled fretwork on the arched style of the headboard and mirror. Dream sweet dreams within the beauty of the rich country styled Timberline Bedroom Collection.\r\n\r\nFREE Bedframe included.\r\n\r\nSeries No: B258\r\nName: Timberline\r\nStyle: Rustic\r\nMaster Bedroom\r\nSignature Casegoods\r\nColors: Replicated Cherry Grain\r\nPart of the Timberline Bedroom Set by Signature Design by Ashley Furniture\r\n\r\nFeatures:\r\n Replicated warm brown Timber Cherry grain.\r\n Nicely scaled accent fretwork.\r\n\r\nDimensions:\r\n Queen/Full Panel Headboard 67"W x 3"D x 50"H\r\n Queen (Bolt-on) Bedframe 61"W x 70"D x 9"H\r\n\r\nSome assembly may be required.'),
(10, 4, 62, 0, 3, 'The Timberline Queen / Full Panel Headboard by Signature Design by Ashley Furniture from the "Timberline" bedroom collection grasps the true beauty of country style furniture and brings it to your home. The replicated brown cherry grain is beautifully accented by the nicely scaled fretwork on the arched style of the headboard and mirror. Dream sweet dreams within the beauty of the rich country styled Timberline Bedroom Collection.'),
(11, 4, 72, 0, 3, ''),
(12, 4, 95, 0, 3, ''),
(13, 4, 61, 0, 4, 'With a rich finish and ornate details, the Camilla Nightstand by Millennium from the "Camilla" bedroom collection takes rich traditional design to create an atmosphere of sophistication that is sure to enhance any home decor. The rich cherry veneer is bathed in a dark brown finish that beautifully enhances the pecan veneer accented case tops creating an elegant furniture collection. With antique bronze color hardware adorning the case pieces, this bedroom furniture perfectly captures the atmosphere of grand traditional design. Create the bedroom of your dreams with the rich traditional elegance of the "Camilla" Bedroom Collection.\r\n\r\nSeries No: B622\r\nName: Camilla\r\nStyle: Traditional\r\nColors: Brown Cherry Stain Finish\r\nPart of the Camilla Bedroom Set by Millennium\r\n\r\nFeatures:\r\n Made with select cherry veneer and hardwood solids.\r\n Pecan veneer accented tops.\r\n Dark brown finish.\r\n Antique bronze color hardware.\r\n\r\nDimensions:\r\n Night Stand 35"W x 19"D x 31"H\r\n  Bottom Drawers (2)   26 X 14 1/2 X 5 1/2\r\n  Top drawer: Black felt lined   26 X 14 1/2 X 5 1/2\r\n\r\nSome assembly may be required.'),
(14, 4, 62, 0, 4, 'With a rich finish and ornate details, the Camilla Nightstand by Millennium from the "Camilla" bedroom collection takes rich traditional design to create an atmosphere of sophistication that is sure to enhance any home decor. The rich cherry veneer is bathed in a dark brown finish that beautifully enhances the pecan veneer accented case tops creating an elegant furniture collection. With antique bronze color hardware adorning the case pieces, this bedroom furniture perfectly captures the atmosphere of grand traditional design. Create the bedroom of your dreams with the rich traditional elegance of the "Camilla" Bedroom Collection.'),
