(19, 4, 61, 0, 5, 'Millennium by Ashley© Furniture has grown to become the largest home furniture manufacturing company. Millennium by Ashley© Furniture has a rich history of success stories that illustrate its dramatic transition from a ‘virtual unknown’ to a significant force in the industry. For over half of a century, the Millennum by Ashley© Furniture has remained committed to its Vision Statement: "We Want To Be The Best Furniture Company." Innovative marketing concepts, quality products and state-of-the-art manufacturing methods have always been driven by the demand for customer satisfaction. The stream of satisfied customers continues to grow as Signature Design by Ashley© Furniture continues to be creative and diversifies to expand business, and improve quality into the next millennium. '),
(20, 4, 62, 0, 5, 'Millennium by Ashley© Furniture has grown to become the largest home furniture manufacturing company. Millennium by Ashley© Furniture has a rich history of success stories that illustrate its dramatic transition from a ‘virtual unknown’ to a significant force in the industry. For over half of a century, the '),
