(25, 4, 61, 0, 6, 'A deep rich stained finish and exquisite details come together to create the ultimate in grand traditional design with the elegance of the North Shore Formal Dining Room Set by Millennium by Ashley Furniture from the "North Shore" Dining Room Collection. The opulent brown stained finish flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any dining experience. With the comfort and beauty of elegant chairs, this furniture collection takes traditional style to the next level. Transform your dining area with the rich style of the "North Shore" Dining Room Collection.\r\n\r\nSeries No: D553\r\nName: North Shore\r\nStyle: Traditional\r\nColors: Dark Brown Finish\r\nPart of the North Shore Dining Room Collection by Millennium by Ashley Furniture\r\n\r\nSet Includes: 2 Side Chair (Set of 2), 1 Arm Chair (Set of 2), 1 Extension Pedestal Table; Optional Item(s): Server, China Buffet, Buffet\r\n\r\nFeatures:\r\n Distressed dark opulent brown stained finish.\r\n Constructed with select hardwood veneers, hardwood solids and furniture grade resin.\r\n Large scale decorative pilasters and ornately detailed appliques.\r\n Framed drawer fronts.\r\n Felt-lined flatware tray with dust cover.\r\n Mirror back china with three way "touch" light switch.\r\n\r\nDimensions:\r\n Extension Pedestal Table 44"W x 44/108 x 30"H\r\n Side Chair (RTA) (2/Ctn) 22"W x 22"D x 44"H\r\n Arm Chair (RTA) (2/Ctn) 22"W x 24"D x 44"H\r\n\r\n D553-80 Buffet 70"W x 18"D x 34"H\r\n  CENTER ADJUSTABLE SHELF   18 3/16" x 13 11/16" x 3/4"\r\n  CENTER DRAWER (LINED)   17 1/16" x 12 1/2" x 2 1/2"\r\n  DOOR OPENING (3)   18 1/4" x 13 3/4" x 19 7/8"\r\n  SIDE ADJUSTABLE SHELF (2)   20 9/16" x 13 3/4" x 3/4"\r\n  SIDE DRAWER (LINED)(2)   17 1/16" x 12 1/2" x 2 13/16"\r\n\r\n D553-81 China 70"W x 18"D x 57"H\r\n  DOOR OPENING   32 1/2" x 13 5/8" x 44"\r\n\r\n D553-60 Server 71"W x 20"D x 42"H\r\n  ADJUSTABLE SHELF (2)   20 1/8" x 14 5/8" x 5/8"\r\n  CENTER BOTTOM DRAWER (LINED) (2)   20 1/16" x 14" x 6 1/8"\r\n  CENTER MIDDLE DRAWER (LINED)   20 1/16" x 14" x 8 3/4"\r\n  DOOR OPENING (2)   17 1/2" x 16" x 27 1/2"\r\n  TOP CENTER DRAWER (LINED)   20 1/16" x 14" x 2 3/4"\r\n  TOP SIDE DRAWER (LINED) (2)   15 1/2" x 13" x 2 3/4"\r\n\r\nSome assembly may be required.'),
(26, 4, 62, 0, 6, 'A deep rich stained finish and exquisite details come together to create the ultimate in grand traditional design with the elegance of the North Shore Formal Dining Room Set by Millennium by Ashley Furniture from the "North Shore" Dining Room Collection. The opulent brown stained finish flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any dining experience. With the comfort and beauty of elegant chairs, this furniture collection takes traditional style to the next level. Transform your dining area with the rich style of the "North Shore" Dining Room Collection.'),
