(31, 4, 61, 0, 7, 'The Rich Cappuccino Table by Coaster with its smooth design and rich coloring is sure to embellish any home environment. This elegant table is crafted from solid hardwoods and features a wood veneer table top. With its clean lines and stylish look this contemporary piece from the Rich Cappuccino Collection will easily blend with your dining interior.\r\n\r\nFeatures:\r\n Contemporary style\r\n Rich cappuccino finish\r\n Solid hardwoods\r\n Wood veneer table top\r\n\r\nDimensions:\r\n Table: 60”L x 36”W x 30”H\r\n\r\nSome assembly may be required.'),
