(37, 4, 61, 0, 8, 'The rich country style of the Berringer Pub Set from the "Berringer" Dining Room Collection reflects back to the days when beautifully crafted furniture was made by hand to enhance the look of your home. The rich rustic look of the hand-applied finish flawlessly coats the sturdy construction of this exceptional dining room furniture to create a warm inviting atmosphere for any dining experience. With the simple beauty of this country styled furniture, the “Berringer” Casual Dining Collection is sure to enhance any home’s beauty.\r\n\r\nSeries No: D199\r\nName: Berringer\r\nStyle: Cottage\r\nColors: Rustic\r\n\r\nFeatures:\r\n Solid hardwood construction.\r\n Rustic hand applied finish. \r\n Backless bar stool features faux leather upholstery.\r\n\r\nDimensions:\r\n Rect Pub Table w/ Two 24in Backless Barstools (3/Ctn) 32"W x 24"D x 34"H\r\n\r\n Table   32"W x 24"D x 34"H\r\n  FROM FLOOR TO TABLE APRON   30 7/8"\r\n  FROM FLOOR TO TABLE STRETCHER   5 3/8"\r\n\r\n Barstool (2)   19"W x 11 7/8"D x 24 1/8"H\r\n  BARSTOOL FOOT REST HEIGHT   9 1/16"\r\n\r\nSome assembly may be required.'),
(38, 4, 62, 0, 8, 'The rich country style of the Berringer Pub Set from the "Berringer" Dining Room Collection reflects back to the days when beautifully crafted furniture was made by hand to enhance the look of your home. The rich rustic look of the hand-applied finish flawlessly coats the sturdy construction of this exceptional dining room furniture to create a warm inviting atmosphere for any dining experience. With the simple beauty of this country styled furniture, the “Berringer” Casual Dining Collection is sure to enhance any home’s beauty.'),
