(47, 4, 61, 0, 11, 'The Marble Top Bar Set by Coaster features 3 drawers and a wine rack on each end, a set of cabinets, a large preparation area and a beautiful marble counter top. Matching bar stool features faux wicker design with a leather seat.\r\n\r\nSet Includes: 2 29 Inch Brown Barstool, 1 Marble Top Brown Bar\r\n\r\nFeatures:\r\n Durable construction.\r\n Stylish and practical furniture design.\r\n 3 drawers.\r\n Wine rack on each end.\r\n Set of cabinets.\r\n Large preparation area.\r\n Marble counter top.\r\n Bar stool features faux wicker design with a leather seat.\r\n\r\nDimensions:\r\n Bar Unit: 20"l   60"w   42"h\r\n Barstool: 24"l   25"w   46"h\r\n\r\nSome assembly may be required.\r\n'),
