(51, 4, 61, 0, 12, 'Fill your home with warm memories of days gone by with the Antigo Sofa Table by Ashley Furniture With the natural slate tiling and the “gunmetal” color finish, you can bring back the memories of backyards and barbecues of youth. The unique grilled shelf and range of tones within the tiles bring the outdoors into the warm comfort of your own living room. Welded metal frames with a baked epoxy finish gives the "Antigo" occasional table collection the strength that the look demands.\r\n\r\nFeatures:\r\n Wrought Iron Frames\r\n Baked Epoxy Gunmetal Color Finish\r\n Tile Inserts of Natural Slate Tiles\r\n Grilled shelf\r\n\r\nDimensions:\r\n Sofa Table: 29"H x 48"Wx 20"D'),
(52, 4, 62, 0, 12, 'Fill your home with warm memories of days gone by with the Antigo Sofa Table by Ashley Furniture With the natural slate tiling and the “gunmetal” color finish, you can bring back the memories of backyards and barbecues of youth. The unique grilled shelf and range of tones within the tiles bring the outdoors into the warm comfort of your own living room. Welded metal frames with a baked epoxy finish gives the "Antigo" occasional table collection the strength that the look demands.'),
