(55, 4, 61, 0, 13, 'The clean look of sophisticated style comes to life with the rich finish and contemporary accents of the beautifully designed Pinella Entertainment Wall by Signature Design.  Bathed in a rich merlot finish, this entertainment wall is perfectly accented with silver color finished ring pull hardware and glass shelves within the lighted piers to create an overall contemporary atmosphere to enhance any living environment. With clear glass doors on the curved front of the credenza, this furniture fits flawlessly into any decor. Accent the beauty of your living area with the contemporary design of the "Pinella" entertainment wall.\r\n\r\nFeatures:\r\n Durable construction.\r\n Stylish and practical furniture design.\r\n Merlot finish over replicated mahogany grain.\r\n Elegant reeded ring pull hardware.\r\n Side roller glide drawer system for smooth operating drawers.\r\n Glass shelves with lighted piers.\r\n 60" wide TV credenza with curved drawer.\r\n Front glass doors and adjustable shelves.\r\n Bridge with shelf.\r\n Sharp looking reeded moulding.\r\n\r\nDimensions:\r\n W403-24 (2)  Pier Cabinet       20"W x 15"D x 64"H \r\n W403-25  Bridge                       66"W x 17"D x 8"H\r\n W403-60  60 inch Credenza     60"W x 20"D x 24"H\r\n\r\nSome assembly may be required.'),
(56, 4, 62, 0, 13, 'The clean look of sophisticated style comes to life with the rich finish and contemporary accents of the beautifully designed Pinella Entertainment Wall by Signature Design.  Bathed in a rich merlot finish, this entertainment wall is perfectly accented with silver color finished ring pull hardware and glass shelves within the lighted piers to create an overall contemporary atmosphere to enhance any living environment. With clear glass doors on the curved front of the credenza, this furniture fits flawlessly into any decor. Accent the beauty of your living area with the contemporary design of the "Pinella" entertainment wall.\r\n'),
