(58, 4, 95, 0, 13, ''),
(59, 4, 61, 0, 14, 'The Diana Panel Bedroom Set is manufactured by Standard Furniture as part of the Diana Youth Bedroom Collection. Give your princess her own Victorian retreat. Some pieces feature open panel construction with metal roller bearing glides. Other pieces feature folded case side construction with center-mounted runners. Mirrors are back mounted and reinforced. With its simulated, white wash wood grain color and brushed-white, brass color swing bail pulls and clear plastic knobs, this set will give your daughter the fairytale bedroom she has always dreamed of.\r\n\r\nThis set consists of bed (full/queen headboard), nightstand, dresser & mirror.\r\n\r\nSet Includes: 1 Panel Full/Queen Headboard, 1 Door Dresser, 1 Panel Mirror, 1 Nightstand; Optional Item(s): TV Chest, Computer Desk w/ Hutch, Chest 5- Drawer, Computer Desk\r\n\r\nFeatures:\r\n Diana Collection.\r\n Wood products with simulated wood grain laminates.\r\n This group may contain plastic parts.\r\n Some pieces feature open panel construction with metal roller bearing glides.\r\n Other pieces feature folded case side construction with center-mounted runners.\r\n Mirrors are back mounted and reinforced.\r\n Brushed-white, brass color swing bail pulls and clear plastic knobs.\r\n Bun feet raise cases off the floor\r\n Case doors open to reveal spacious storage compartments.\r\n Desk keyboard operates on metal glide system.\r\n Desk hutch accommodates two CD towers.\r\n Profiled toe plates complement overall flowing feel.\r\n\r\nDimensions:\r\n Headboard Panel (Full/Queen): 56"H x 64"W x 2"D\r\n 4057 Nightstand 22"W x 16"D x 24"H\r\n 4058 Single Dresser 32"W x 16"D x 32"H\r\n 4059 Door Dresser 58"W x 16"D x 32"H\r\n 4068 Twin Panel Mirror 31"W x 44"H\r\n\r\n 4055 5- Drawer Chest 32"W x 16"D x 48"H\r\n 4056 TV Chest 39"W x 18"D x 40"H\r\n\r\n 4084 Computer Desk 47"W x 21"D x 30"H\r\n 4085 Hutch 45"W x 12"D x 49"H'),
(60, 4, 62, 0, 14, 'The Diana Panel Bedroom Set is manufactured by Standard Furniture as part of the Diana Youth Bedroom Collection. Give your princess her own Victorian retreat. Some pieces feature open panel construction with metal roller bearing glides. Other pieces feature folded case side construction with center-mounted runners. Mirrors are back mounted and reinforced. With its simulated, white wash wood grain color and brushed-white, brass color swing bail pulls and clear plastic knobs, this set will give your daughter the fairytale bedroom she has always dreamed of.'),
