(63, 4, 61, 0, 15, 'Spring Garden Baby Room Set w/ Pink Metal Crib by Lea Industries. This set will remind you of being a child and running through a field on a warm and breezy spring day picking flowers and discovering all the soft colors of nature. The crib features three position mattress support elegant design soft curves supported by spindles with graceful detail. This stylish metal crib also meets safety guidelines and is JPMA certified. You can also add a Changing Top and 3-Drawer or 6-Drawer Dresser which provides sufficient storage for baby''s clothes. The dresser is crafted from hardwoods and other wood products and comes in a beautiful white finish with accompanying hardwood knob handles in white pink and yellow. The Spring Garden Collection can help you create your perfect nursery.\r\n\r\nSet Includes: 1 Pink Metal Crib, 1 Nightstand; Optional Item(s): Changing Table Top White, Single Dresser, Drawer Chest, Double Dresser\r\n\r\nFeatures:\r\n Durable construction.\r\n Crafted of metal.\r\n Bed features Pastel Pink Painted finish.\r\n Three position mattress support.\r\n Metal frame mattress support.\r\n Lead free finishes.\r\n No sharp edges or corners.\r\n White nightstand and dresser comes with 3 colored hardware knobs: White Pink and Yellow.\r\n Pink nightstand comes with pink knob and Yellow nightstand comes with yellow knob.\r\n Crib meets or exceeds the American Society for testing and material safety standards developed in conjunction with the Consumer Product Safety Commission & Certified by the Juvenile Products Manufacturer Association.\r\n\r\nDimensions:\r\n Metal Crib W-55" x D-32" x H-49"\r\n Nightstand W-20" x D-16" x H-30"\r\n\r\n Chest W-36" x D-18" H-51"\r\n Single Dresser W-44" x D-18" x H-30"\r\n Double Dresser W-54" x D-18" x H-32"'),
(64, 4, 62, 0, 15, 'Spring Garden Baby Room Set w/ Pink Metal Crib by Lea Industries. This set will remind you of being a child and running through a field on a warm and breezy spring day picking flowers and discovering all the soft colors of nature. The crib features three position mattress support elegant design soft curves supported by spindles with graceful detail.'),
