(75, 4, 61, 0, 18, 'The Perfect Sleeper Sanders Mattress-Super Pillow Top Set from the Perfect Sleeper Collection designed and manufactured by Serta guarantees endless comfort and timeless quality. Like any other product from this manufacturer, you can expect this mattress to live up to all of your expectations and even more, due to its innovative features and design. Misty Midnight has the 532-continuous innerspring support system made from continuous coils that are placed from head to toe to enhance comfort and lessen the impact of partner movements. The latter is also ensured by the stable base dual beam that significantly reduces the mattress sway. The Super Pillow top upholstery features the fire blocker insulator covering the two-inch comfort foam; while the bottom includes the fire blocker system with support foam and fire blocker insulator to prevent traumas when the mattress is exposed to open flame. The advanced comfort quilt with another layer of fire blocker and soft convoluted foam and one-inch comfort foam are designed to reduce body pressure and improve surface comfort and overall body circulation.\r\n\r\nThe Perfect Sleeper Sanders Mattress featured in the Perfect Sleeper Collection is available in California King, King, Queen, Twin, Full, and Twin Extra Long sizes.\r\n\r\nPlease note: King & California King Mattress Boxspring is a 2 piece boxspring.\r\n\r\nFREE Boxspring included.\r\n\r\nSet Includes: 1 Sanders Mattress-Super Pillow Top (Twin)\r\n\r\nFeatures:\r\n Perfect Sleeper Collection\r\n Serta quality\r\n Continuous Support System\r\n Foam encasement\r\n Stable-Base Dual Beam Frame\r\n Fire Blocker System\r\n Comfort foam\r\n Convoluted foam\r\n Advanced Comfort Quilt\r\n Euro top\r\n\r\nDimensions:\r\n Twin: W39 x L75"\r\n Twin extra long: W39" x L80"\r\n Full: W54" x L75"\r\n Queen: W60" x L80"\r\n King: W76" x L80"\r\n California King: W72" x L84"\r\n\r\n Mattress Height 15" (Mattress only)'),
(76, 4, 62, 0, 18, 'The Perfect Sleeper Sanders Mattress-Super Pillow Top Set from the Perfect Sleeper Collection designed and manufactured by Serta guarantees endless comfort and timeless quality. Like any other product from this manufacturer, you can expect this mattress to live up to all of your expectations and even more, due to its innovative features and design.'),
