INSERT INTO `catalog_product_flat_1` (`entity_id`, `attribute_set_id`, `type_id`, `cost`, `created_at`, `enable_googlecheckout`, `gift_message_available`, `has_options`, `image_label`, `is_imported`, `is_recurring`, `links_exist`, `links_purchased_separately`, `links_title`, `name`, `news_from_date`, `news_to_date`, `price`, `price_type`, `price_view`, `recurring_profile`, `required_options`, `shipment_type`, `short_description`, `sku`, `sku_type`, `small_image`, `small_image_label`, `special_from_date`, `special_price`, `special_to_date`, `tax_class_id`, `thumbnail`, `thumbnail_label`, `updated_at`, `url_key`, `url_path`, `visibility`, `weight`, `weight_type`) VALUES
(1, 4, 'simple', NULL, '2012-07-20 13:11:15', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Eero Aarnio Ball Chair', NULL, NULL, 8000.0000, NULL, NULL, NULL, 0, NULL, 'Eero Aarnio Ball Chair 599 plus 200 shipping Brand new and will ship within 24 hours! 30 day 100% money back guarantee! This reproduction of Eero Aarnio''s Ball Chair is definitely unique in its design.\r\n\r\nThis retro lounge chair resembles a space-age pod which creates interest for anyone who sees it. The inner shell lined with fabric offers a sense of privacy and retreat as you relax in the plush cushion seating. It''s exterior; Molded fiberglass shell and matching fiberglass base with an integrated swivel mechanism.', 'abc', NULL, '/f/u/funiture_1_7.jpg', '', '2012-07-20 00:00:00', 7000.0000, NULL, 0, '/f/u/funiture_1_7.jpg', '', '2012-07-24 09:17:20', 'eero-aarnio-ball-chair', 'eero-aarnio-ball-chair.html', 4, 3.0000, NULL),
(2, 4, 'simple', NULL, '2012-07-21 10:04:36', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'North Shore Sleigh Bedroom Set', NULL, NULL, 4112.0600, NULL, NULL, NULL, 0, NULL, 'A rich traditional design and exquisite details of the North Shore Media Chest come together to create the ultimate in the grand style of the "North Shore" Bedroom Collection. The opulent brown color flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any home environment. With a serpentine shaped design and inlay stone veneer tops, this furniture collection takes traditional style to the next level. Transform your bedroom with the rich style of the "North Shore" Bedroom Collection.', 'ash', NULL, '/b/5/b553-sleigh-mood_4.jpg', '', '2012-07-21 00:00:00', 2713.9600, NULL, 0, '/b/5/b553-sleigh-mood_4.jpg', '', '2012-07-24 09:15:24', 'north-shore-sleigh-bedroom-set', 'north-shore-sleigh-bedroom-set.html', 4, 70.0000, NULL),
(3, 4, 'simple', NULL, '2012-07-21 10:20:41', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Timberline Queen / Full Panel Headboard', NULL, NULL, 499.9900, NULL, NULL, NULL, 0, NULL, 'The Timberline Queen / Full Panel Headboard by Signature Design by Ashley Furniture from the "Timberline" bedroom collection grasps the true beauty of country style furniture and brings it to your home. The replicated brown cherry grain is beautifully accented by the nicely scaled fretwork on the arched style of the headboard and mirror. Dream sweet dreams within the beauty of the rich country styled Timberline Bedroom Collection.', 'FX00005421', NULL, '/b/2/b258-55_4.jpg', '', '2012-07-21 00:00:00', 399.9900, NULL, 0, '/b/2/b258-55_4.jpg', '', '2012-07-24 09:14:48', 'timberline-queen-full-panel-headboard', 'timberline-queen-full-panel-headboard.html', 4, 50.0000, NULL),
(4, 4, 'simple', NULL, '2012-07-21 10:21:55', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'TCamilla Nightstand', NULL, NULL, 4629.9900, NULL, NULL, NULL, 0, NULL, 'With a rich finish and ornate details, the Camilla Nightstand by Millennium from the "Camilla" bedroom collection takes rich traditional design to create an atmosphere of sophistication that is sure to enhance any home decor. The rich cherry veneer is bathed in a dark brown finish that beautifully enhances the pecan veneer accented case tops creating an elegant furniture collection. With antique bronze color hardware adorning the case pieces, this bedroom furniture perfectly captures the atmosphere of grand traditional design. Create the bedroom of your dreams with the rich traditional elegance of the "Camilla" Bedroom Collection.', 'FX00033964', NULL, '/b/6/b622-93_4.jpg', '', '2012-07-21 00:00:00', 362.0600, NULL, 0, '/b/6/b622-93_4.jpg', '', '2012-07-24 09:14:02', 'timberline-queen-full-panel-headboard', 'timberline-queen-full-panel-headboard-2.html', 4, 50.0000, NULL),
(5, 4, 'simple', NULL, '2012-07-21 10:27:31', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Bradington - Truffle Living Room Set', NULL, NULL, 1691.1500, NULL, NULL, NULL, 0, NULL, 'Millennium by Ashley© Furniture has grown to become the largest home furniture manufacturing company. Millennium by Ashley© Furniture has a rich history of success stories that illustrate its dramatic transition from a ‘virtual unknown’ to a significant force in the industry. For over half of a century, the ', '15400-LR-SET', NULL, '/1/5/15400-38-35-t496-8-lr-set_4_1.jpg', '', '2012-07-21 00:00:00', 1451.1000, NULL, 0, '/1/5/15400-38-35-t496-8-lr-set_4_1.jpg', '', '2012-07-24 09:13:34', 'timberline-queen-full-panel-headboard', 'timberline-queen-full-panel-headboard-1.html', 4, 50.0000, NULL),
(6, 4, 'simple', NULL, '2012-07-23 04:16:54', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'North Shore Formal Dining Room Set', NULL, NULL, 2393.8800, NULL, NULL, NULL, 0, NULL, 'A deep rich stained finish and exquisite details come together to create the ultimate in grand traditional design with the elegance of the North Shore Formal Dining Room Set by Millennium by Ashley Furniture from the "North Shore" Dining Room Collection. The opulent brown stained finish flows beautifully over the decorative pilasters and ornate detailed appliques to create a rich elegant atmosphere to any dining experience. With the comfort and beauty of elegant chairs, this furniture collection takes traditional style to the next level. Transform your dining area with the rich style of the "North Shore" Dining Room Collection.', 'D553-FORMAL-DR-SET', NULL, '/d/5/d553-55-03_6_-60_4.jpg', '', '2012-07-22 00:00:00', 1579.9600, NULL, 0, '/d/5/d553-55-03_6_-60_4.jpg', '', '2012-07-24 09:13:12', 'north-shore-formal-dining-room-set', 'north-shore-formal-dining-room-set.html', 4, 50.0000, NULL),
(7, 4, 'simple', NULL, '2012-07-23 04:20:54', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Rich Cappuccino Table', NULL, NULL, 399.9900, NULL, NULL, NULL, 0, NULL, 'The Rich Cappuccino Table by Coaster with its smooth design and rich coloring is sure to embellish any home environment. This elegant table is crafted from solid hardwoods and features a wood veneer table top. With its clean lines and stylish look this contemporary piece from the Rich Cappuccino Collection will easily blend with your dining interior.', '100771', NULL, '/1/0/100771-table_4.jpg', '', '2012-07-22 00:00:00', 279.9900, NULL, 0, '/1/0/100771-table_4.jpg', '', '2012-07-24 09:16:06', 'north-shore-formal-dining-room-set', 'north-shore-formal-dining-room-set-1.html', 4, 50.0000, NULL),
(8, 4, 'simple', NULL, '2012-07-23 04:23:42', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Berringer Pub Set', NULL, NULL, 399.9900, NULL, NULL, NULL, 0, NULL, 'The rich country style of the Berringer Pub Set from the "Berringer" Dining Room Collection reflects back to the days when beautifully crafted furniture was made by hand to enhance the look of your home. The rich rustic look of the hand-applied finish flawlessly coats the sturdy construction of this exceptional dining room furniture to create a warm inviting atmosphere for any dining experience. With the simple beauty of this country styled furniture, the “Berringer” Casual Dining Collection is sure to enhance any home’s beauty.', 'D199-113', NULL, '/d/1/d199-113-dinette_4.jpg', '', '2012-07-22 00:00:00', 279.9900, NULL, 0, '/d/1/d199-113-dinette_4.jpg', '', '2012-07-24 09:11:37', 'berringer-pub-set', 'berringer-pub-set.html', 4, 50.0000, NULL),
(11, 4, 'simple', NULL, '2012-07-23 04:39:50', 1, 0, 0, NULL, 0, 0, NULL, NULL, NULL, 'Marble Top Bar Set', NULL, NULL, 1955.1800, NULL, NULL, NULL, 0, NULL, 'The Marble Top Bar Set by Coaster features 3 drawers and a wine rack on each end, a set of cabinets, a large preparation area and a beautiful marble counter top. Matching bar stool features faux wicker design with a leather seat.', '100173-174', NULL, 'no_selection', NULL, '2012-07-22 00:00:00', 1309.9700, NULL, 0, 'no_selection', NULL, '2012-07-24 09:10:55', 'marble-top-bar-set', 'marble-top-bar-set.html', 4, 2.0000, NULL),
(12, 4, 'simple', NULL, '2012-07-23 04:44:19', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Antigo Sofa Table', NULL, NULL, 357.1300, NULL, NULL, NULL, 0, NULL, 'Fill your home with warm memories of days gone by with the Antigo Sofa Table by Ashley Furniture With the natural slate tiling and the “gunmetal” color finish, you can bring back the memories of backyards and barbecues of youth. The unique grilled shelf and range of tones within the tiles bring the outdoors into the warm comfort of your own living room. Welded metal frames with a baked epoxy finish gives the "Antigo" occasional table collection the strength that the look demands.', 'T233-4', NULL, '/t/2/t233-4_4_1.jpg', '', '2012-07-22 00:00:00', 249.9900, NULL, 0, '/t/2/t233-4_4_1.jpg', '', '2012-07-24 09:10:30', 'antigo-sofa-table', 'antigo-sofa-table.html', 4, 2.0000, NULL),
(13, 4, 'simple', NULL, '2012-07-23 04:49:18', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Pinella Entertainment Wall', NULL, NULL, 1042.8400, NULL, NULL, NULL, 0, NULL, 'The clean look of sophisticated style comes to life with the rich finish and contemporary accents of the beautifully designed Pinella Entertainment Wall by Signature Design.  Bathed in a rich merlot finish, this entertainment wall is perfectly accented with silver color finished ring pull hardware and glass shelves within the lighted piers to create an overall contemporary atmosphere to enhance any living environment. With clear glass doors on the curved front of the credenza, this furniture fits flawlessly into any decor. Accent the beauty of your living area with the contemporary design of the "Pinella" entertainment wall.\r\n', 'W403-24(2)-25-60', NULL, '/w/4/w403-60-a-credenza-4.jpg', '', '2012-07-22 00:00:00', 729.9900, NULL, 0, '/w/4/w403-60-a-credenza-4.jpg', '', '2012-07-24 09:09:58', 'pinella-entertainment-wall', 'pinella-entertainment-wall.html', 4, 34.0000, NULL),
(14, 4, 'simple', NULL, '2012-07-23 04:52:14', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Diana Panel Bedroom Set', NULL, NULL, 1166.6100, NULL, NULL, NULL, 0, NULL, 'The Diana Panel Bedroom Set is manufactured by Standard Furniture as part of the Diana Youth Bedroom Collection. Give your princess her own Victorian retreat. Some pieces feature open panel construction with metal roller bearing glides. Other pieces feature folded case side construction with center-mounted runners. Mirrors are back mounted and reinforced. With its simulated, white wash wood grain color and brushed-white, brass color swing bail pulls and clear plastic knobs, this set will give your daughter the fairytale bedroom she has always dreamed of.', '4050PANSET', NULL, '/4/0/4050panset_4.jpg', '', '2012-07-22 00:00:00', 769.9600, NULL, 0, '/4/0/4050panset_4.jpg', '', '2012-07-24 09:09:32', 'diana-panel-bedroom-set', 'diana-panel-bedroom-set.html', 4, 1.0000, NULL),
(15, 4, 'simple', NULL, '2012-07-23 05:03:52', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Spring Garden Baby Room Set w/ Pink Metal Crib', NULL, NULL, 1575.0000, NULL, NULL, NULL, 0, NULL, 'Spring Garden Baby Room Set w/ Pink Metal Crib by Lea Industries. This set will remind you of being a child and running through a field on a warm and breezy spring day picking flowers and discovering all the soft colors of nature. The crib features three position mattress support elegant design soft curves supported by spindles with graceful detail.', '418-997P-CRIB-SET', NULL, '/l/e/lea-418-997p-m-crib-set_4.jpg', '', '2012-07-22 00:00:00', 945.0000, NULL, 0, '/l/e/lea-418-997p-m-crib-set_4.jpg', '', '2012-07-24 09:09:09', 'spring-garden-baby-room-set-w-pink-metal-crib', 'spring-garden-baby-room-set-w-pink-metal-crib.html', 4, 5.0000, NULL),
(16, 4, 'simple', NULL, '2012-07-23 05:10:44', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Swivel Arm Chair on Casters ', NULL, NULL, 285.7000, NULL, NULL, NULL, 0, NULL, 'This luxurious Arm Chair features a wonderful Swivel Mechanism and casters for extra support. Additionally, the Chrome framing and beautiful Black Vinyl upholstery enhance its commitment to grace and sophistication. ', '0609-AC-BLK', NULL, '/6/9/6910-0609_4.jpg', '', '2012-07-22 00:00:00', 199.9900, NULL, 0, '/6/9/6910-0609_4.jpg', '', '2012-07-24 09:08:48', 'swivel-arm-chair-on-casters', 'swivel-arm-chair-on-casters.html', 4, 43.0000, NULL),
(17, 4, 'simple', NULL, '2012-07-23 05:14:36', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Soho - Black Rug', NULL, NULL, 328.5600, NULL, NULL, NULL, 0, NULL, 'The  Soho - Black Rug by Ashley Furniture. Crafted with uncommon quality, this exquisite collection features a series of  designs capturing the essence of contemporary majesty. The rugs are made from nylon(100%). This extraordinary combination of design, color and styling will add a wonderful accent to any setting.', 'R134', NULL, '/r/1/r134002_4.jpg', '', '2012-07-22 00:00:00', 229.9900, NULL, 0, '/r/1/r134002_4.jpg', '', '2012-07-24 09:12:06', 'soho-black-rug', 'soho-black-rug.html', 4, 45.0000, NULL),
(18, 4, 'simple', NULL, '2012-07-23 05:17:53', 1, 0, 0, NULL, 0, 0, NULL, NULL, NULL, 'Perfect Sleeper Sanders Mattress-Super Pillow Top Set', NULL, NULL, 1428.5600, NULL, NULL, NULL, 0, NULL, 'The Perfect Sleeper Sanders Mattress-Super Pillow Top Set from the Perfect Sleeper Collection designed and manufactured by Serta guarantees endless comfort and timeless quality. Like any other product from this manufacturer, you can expect this mattress to live up to all of your expectations and even more, due to its innovative features and design.', '012643-SET', NULL, 'no_selection', NULL, '2012-07-22 00:00:00', 999.9900, NULL, 0, 'no_selection', NULL, '2012-07-24 07:29:22', 'perfect-sleeper-sanders-mattress-super-pillow-top-set', 'perfect-sleeper-sanders-mattress-super-pillow-top-set.html', 4, 2.0000, NULL),
(19, 4, 'simple', NULL, '2012-07-23 05:33:27', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Shelton Traditional Rectangular End Table', NULL, NULL, 251.9800, NULL, NULL, NULL, 0, NULL, 'Accent your living room furniture with the stylish rectangular end table. A traditional styled nailhead accent and decorative hardware create a warm and inviting look. Two drawers allow for convenient storage of books, magazines, remotes and reading glasses. Pair with the matching chairside end table, sofa table and cocktail table.', '4564', NULL, '/s/h/shelton_489_t489-3-b.jpg', '', '2012-07-22 00:00:00', 83.9900, NULL, 0, '/s/h/shelton_489_t489-3-b.jpg', '', '2012-07-24 07:28:51', 'shelton-traditional-rectangular-end-table', 'shelton-traditional-rectangular-end-table.html', 4, 445.0000, NULL),
(20, 4, 'simple', NULL, '2012-07-23 05:40:48', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Bedroom TV Armoire', NULL, NULL, 1629.6000, NULL, NULL, NULL, 0, NULL, 'Perfect for use with a TV and for organized bedroom storage, this traditional style armoire offers graceful style and function to your master bedroom. The two-tone look of the medium chestnut finish with burl inlays on the two door and two drawer fronts create an impressive look. Intricate hand carved details complete the classic style of this TV Armoire.', '45', NULL, '/2/0/201201_201206-b2.jpg', '', '2012-07-22 00:00:00', 1222.2000, NULL, 0, '/2/0/201201_201206-b2.jpg', '', '2012-07-24 07:28:21', 'bedroom-tv-armoire', 'bedroom-tv-armoire.html', 4, 4.0000, NULL),
(21, 4, 'simple', NULL, '2012-07-23 05:48:00', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Round Pub Table with Metal Base and Faux Marble Top', NULL, NULL, 226.8000, NULL, NULL, NULL, 0, NULL, 'This elegant pub table is a masterfully designed piece with a unique and winsome style that is unparalleled. A faux marble top table ads grace while the antique bronze finish of the metal base and legs gives a strong and stylish presence. Designed to match beautifully with the coordinating stools, this table makes an excellent addition to any room in your home.', '4234133', NULL, '/o/l/olivia_1206_120681-b2.jpg', '', '2012-07-22 00:00:00', 170.1000, NULL, 0, '/o/l/olivia_1206_120681-b2.jpg', '', '2012-07-24 07:27:53', 'round-pub-table-with-metal-base-and-faux-marble-top', 'round-pub-table-with-metal-base-and-faux-marble-top.html', 4, 12.0000, NULL),
(22, 4, 'simple', NULL, '2012-07-23 05:58:16', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Lacey', NULL, NULL, 12345.0000, NULL, NULL, NULL, 0, NULL, 'The rich contemporary design of the Lacey dining room collection features faux marble and a subtle rustic beauty to create a sophisticated atmosphere that is sure to enhance any dining experience. The thick profiled faux marble table top is covered with a clear polyurethane finish and is supported by the slightly tapered contemporary legs in a dark brown finish. The brown vinyl upholstered chairs features the rich look of faux leather with stylish stitching and button tufting to further enhance the upscale contemporary design of this dining collection. Create a sophisticated style for your dining room decor with the inviting feel of the Lacey dining room collection.', '345', NULL, '/l/a/lacey_d328-drl-b1.jpg', '', '2012-07-22 00:00:00', 11200.0000, NULL, 0, '/l/a/lacey_d328-drl-b1.jpg', '', '2012-07-24 07:27:16', 'lacey', 'lacey.html', 4, 34.0000, NULL),
(23, 4, 'simple', NULL, '2012-07-23 06:04:48', 1, 0, 0, '', 0, 0, NULL, NULL, NULL, 'Coaster Promenade Casual Leather Reclining Theater Sectional Group ', NULL, NULL, 2365.2000, NULL, NULL, NULL, 0, NULL, 'Enjoy your next movie night with the enveloping comfort of this luxurious theater sectional group. The left and right arm facing recliners anchor each end of this unit, with a center armless loveseat for comfortable reclining options to accommodate the whole family.', '7852', NULL, '/7/5/7575-_coaster_7575sec-b.jpg', '', '2012-07-22 00:00:00', 1773.9000, NULL, 0, '/7/5/7575-_coaster_7575sec-b.jpg', '', '2012-07-24 07:27:07', 'coaster-promenade-casual-leather-reclining-theater-sectional-group', 'coaster-promenade-casual-leather-reclining-theater-sectional-group.html', 4, 2.0000, NULL);
