INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(5, 'footer_links', 'footer_links', '<div class="icons clearfix">\r\n  <div class="icons_left"> <img src="{{media url="icons/authorize_net.gif"}}" alt="" /><strong>We Accept:</strong> <img src="{{media url="icons/visa.gif"}}" alt="" /><img src="{{media url="icons/mastercard.gif"}}" alt="" /><img src="{{media url="icons/discover.gif"}}" alt="" /><img src="{{media url="icons/blue.gif"}}" alt="" /><img src="{{media url="icons/paypal.gif"}}" alt="" /> </div>\r\n  <div class="icons_right"> <strong>Share This:</strong>\r\n    <div class="share_this">\r\n<span class=''st_sharethis_large'' displayText=''ShareThis''></span>\r\n<span class=''st_facebook_large'' displayText=''Facebook''></span>\r\n<span class=''st_twitter_large'' displayText=''Tweet''></span>\r\n<span class=''st_linkedin_large'' displayText=''LinkedIn''></span>\r\n<span class=''st_email_large'' displayText=''Email''></span>\r\n</div>\r\n  </div>\r\n</div>\r\n<ul>\r\n  <li class="last"><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n</ul>\r\n<script type="text/javascript">var switchTo5x=true;</script>\r\n<script type="text/javascript" src="http://w.sharethis.com/button/buttons.js"></script>\r\n<script type="text/javascript">stLight.options({publisher: "e148acd4-80f3-4c18-80d7-0b2f4e5220f6"}); </script>', '2012-07-20 07:17:02', '2012-07-26 04:34:09', 1),
(6, 'home_page_header_block', 'home_page_header_block', '<div style="position:relative;">{{block type="banners/banners" name="banners" template="banners/banners.phtml"}}</div>\r\n\r\n<div class="slider_bottom"></div>', '2012-07-20 13:04:22', '2012-07-25 06:49:06', 1),
(7, 'head_phone_block', 'head_phone_block', '<ul class="head_contacts_block">\r\n  <li><span class="phone">+1 253.243.2001</span></li>\r\n <li class="last"><a class="mail" href="mailto:info@yourstore.com">info@yourstore.com</a></li>\r\n</ul>\r\n', '2012-07-20 13:04:52', '2012-07-21 05:09:02', 1),
(8, 'right_info_block', 'right_info_block', '<div>{{block type="catalog/product_popular" template="catalog/product/popular.phtml" category_id="4"}}</div>\r\n<br/><br/>\r\n<div class="block testimonial">  \r\n<div class="block-title"><strong><span>Testimonials</span></strong></div>  \r\n<div class="block-content"> \r\n<p><em>I am quite impressed with your level of customer service. I am really satisfied with Premium Magento Template. I will reccomend you to my collegues. I would just like to say a BIG thank you!</em></p>  \r\n<p class="signt">Matthew Bailey</p>\r\n</div> </div> \r\n', '2012-07-20 13:05:13', '2012-07-25 10:40:52', 1),
(9, 'left_info_block', 'left_info_block', '<div>{{block type="catalog/product_popular" template="catalog/product/popular.phtml" category_id="4"}}</div>\r\n<div class="block news_left">\r\n  <div class="block-title"><strong><span>News and events</span></strong></div>\r\n  <div class="block-content">\r\n    <dl>\r\n      <dt><strong>19/12/2011</strong><a href="#">- New Arrivals</a></dt>\r\n      <dd>From cabinets and surfacing to bath fixtures and vanities, peruse the kitchen and  bath industry''s hottest New Products.</dd>\r\n    </dl>\r\n    <p><a  class="more" href="{{store direct_url="new-arrivals.html"}}"><span>Read more</span></a></p>\r\n  </div>\r\n</div>\r\n', '2012-07-20 13:05:49', '2012-07-24 05:56:48', 1),
(10, 'header_custom_menu_default', 'header_custom_menu_default', ' <li><a href="{{store direct_url="shop-by-brands"}}">Shop by Brands</a></li>\r\n <li><a href="{{store direct_url="new-arrivals.html"}}">New Arrivals</a></li>\r\n  <li class="last"><a href="{{store direct_url="catalogsearch/advanced/"}}">Advance Search</a></li>\r\n <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n  <li class="last"><a href="{{store direct_url="contacts"}}">Contact Us</a></li>', '2012-07-23 10:49:27', '2012-07-25 07:06:01', 1),
(11, 'header_custom_menu_ext', 'header_custom_menu_ext', '<div class="menu">\r\n<div class="parentMenu">\r\n<a href="{{store direct_url="shop-by-brands"}}">\r\n<span>Shop by Brands</span>\r\n</a>\r\n</div>\r\n</div>\r\n<div class="menu">\r\n<div class="parentMenu">\r\n<a href="{{store direct_url="new-arrivals.html"}}">\r\n<span>New Arrivals</span>\r\n</a>\r\n</div>\r\n</div>\r\n<div class="menu">\r\n<div class="parentMenu">\r\n<a href="{{store direct_url="catalogsearch/advanced/"}}">\r\n<span>Advance Search</span>\r\n</a>\r\n</div>\r\n</div>\r\n<div class="menu">\r\n<div class="parentMenu">\r\n<a href="{{store direct_url="customer-service"}}">\r\n<span>Customer Service</span>\r\n</a>\r\n</div>\r\n</div>\r\n<div class="menu">\r\n<div class="parentMenu">\r\n<a href="{{store direct_url="contacts"}}">\r\n<span>Contact Us</span>\r\n</a>\r\n</div>\r\n</div>', '2012-07-25 06:59:09', '2012-07-25 07:06:23', 1);
