INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', '', '<div class="page-title"><h1>Whoops, our bad...</h1></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class="disc">\r\n<li><a href="#" onclick="history.back(); return false;">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a> <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li></ul></dd></dl>\r\n', '2007-06-20 18:38:32', '2007-08-26 19:11:13', 1, 0, NULL, NULL, '', NULL, NULL, NULL),
(2, 'Home page', 'two_columns_right', '', '', 'home', '', '<div class="home-page-products-block" >\r\n  <div class="pageblock_title">Featured Products</div>\r\n   <div>{{block type="catalog/product_popular" template="catalog/product/home.phtml" category_id="122" column_count="4" total_count="8"}}</div>\r\n</div>\r\n<div class="home-page-products-block" >\r\n<div class="pageblock_title">New Arrivals</div>\r\n<div>{{block type="catalog/product_popular" template="catalog/product/home.phtml" category_id="3" column_count="4" total_count="8" }}</div>\r\n</div>\r\n<h2>Welcome to the PerfectWhite Magento Template</h2>\r\n<p>The PerfectWhite is a fashionable european design style Magento Template. This Magento theme is elegant, modern, and simple, with a focus on usability. It is perfect for showcasing design products for the house, from smaller objects to lamps and furniture, textile and lighting.</p>\r\n', '2007-08-23 10:03:25', '2012-07-24 12:44:56', 1, 0, '<reference name="header">    <block type="cms/block" name="home_page_header_block">        <action method="setBlockId"><block_id>home_page_header_block</block_id></action>    </block></reference><reference name="head">    <action method="addItem"><type>skin_css</type><name>css/slider.css</name><params/></action>    <action method="addItem"><type>skin_js</type><name>js/jquery-1.5.2.min.js</name></action>    <action method="addItem"><type>skin_js</type><name>js/noconflict.js</name></action>    <action method="addItem"><type>skin_js</type><name>js/cycle-fade-effect.js</name></action>    <action method="addItem"><type>skin_js</type><name>js/slider.js</name></action></reference>', '', '', '', NULL, NULL),
